81	<h1><span style="font-size:16pt"><span style="font-family:&quot;Calibri Light&quot;,sans-serif"><span style="color:#2e74b5"><strong>Урбанизм, туризм и Иссык-Куль</strong></span></span></span></h1>\r\n\r\n<h2><span style="font-size:13pt"><span style="font-family:&quot;Calibri Light&quot;,sans-serif"><span style="color:#2e74b5">В Кыргызстане запустили проект города-резорта UNO CITY</span></span></span></h2>\r\n\r\n<p style="text-align:justify"><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><img src="file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image002.jpg" style="height:365px; width:623px" /></span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">По версии&nbsp;<a href="http://www.nat-geo.ru/top10-lakes/901232-10-kurortov-na-ozerakh-orta/" style="color:#0563c1; text-decoration:underline" target="_blank">National Geographic</a>, Иссык-Куль входит в топ-10 самых популярных и престижных курортов на озерах. Это одна из самых посещаемых туристических зон для разнопланового отдыха. Сюда ежегодно съезжается более миллиона человек из разных стран. С каждым годом приток новых туристов только увеличивается.<br />\r\n<br />\r\nСейчас на побережье озера Иссык-Куль запускается строительство проекта Мухтара Сартманова &ndash; UNO CITY. Это первый туристический город-резорт в Центральной Азии, занимающий территорию более 9 гектаров. Проект обладает всей необходимой инфраструктурой для комфортного отдыха, предлагая качественные условия проживания и оставаясь в гармонии с неприкосновенной природой.</span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><img src="file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image004.jpg" style="height:351px; width:623px" /></span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Над разработкой UNO CITY работала команда архитекторов, которая предусмотрела все запросы современного человека. В проект первого города-резорта включены:</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Объекты социальной инфраструктуры;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Офисы;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Торгово-развлекательные объекты;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Ритейл под жилыми зданиями;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Медицинский комплекс;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Образовательный центр;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Коворкинг-зона;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Ресторанный кластер;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Спортивный комплекс;</span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Конгресс-холл;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Амфитеатр;</span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&bull; Променадная зона.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><img src="file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image006.jpg" style="height:351px; width:623px" /></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Приступая к проектированию UNO CITY, архитекторы уделили особое внимание современному стилю и концепции самого проекта. Заложена концепция использования разных блоков, включающих в себя тренды в форме, соотношении и цвете зданий. Это решение позволит улучшить внутреннюю среду и повысить качество жизни населения.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&laquo;<em>Будущие жители и гости города &ndash; люди, делающие выбор в пользу активности и развития, уделяющие внимание качеству жизни. Это представители разных профессий и сфер деятельности, которые&nbsp;&nbsp; вдохновляются своей работой, пробуют себя в новом, занимаются своим физическим и ментальным здоровьем, изучают себя и мир, стремятся к внутренней гармонии и психологическому спокойствию</em>&raquo; &ndash; <span style="font-size:12.0pt">отмечает автор проекта</span></span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;&nbsp; </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">UNO предлагает миру не продукт, а образ жизни, бизнеса и отдыха. </span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Это место, где динамичная жизнь сочетается с природной гармонией. Здесь планируется запустить коллаборацию международных брендов и крупных сетей. </span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Резидент или посетитель UNO &ndash; часть осознанного сообщества, которое выбирает качественное будущее для себя и своих близких.&nbsp; </span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Одно из ключевых преимуществ UNO CITY &ndash; круглогодичный формат. Мягкий климат и кристально прозрачная вода, насыщенная кислородом, идеально подходят для оздоровления всей семьи. Это мастхэв для комфортного отдыха.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Благодаря потенциалу своего разития, UNO CITY привлекает внимание инвесторов и бизнесменов со всего мира. Немаловажен и факт удачного расположения проекта.</span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif"><img src="file:///C:/Users/user/AppData/Local/Temp/msohtmlclip1/01/clip_image008.jpg" style="height:351px; width:623px" /></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">Автор проекта &ndash; Мухтар Сартманов. Застройщиком выступила международная строительная компания Borsan Construction.</span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&nbsp;</span></span></p>\r\n\r\n<p><span style="font-size:14pt"><span style="font-family:&quot;Times New Roman&quot;,serif">&laquo;<em>UNO CITY &ndash; это город успешного и осознанного настоящего</em>&raquo; &ndash; <span style="font-size:12.0pt">заявляют </span><span dir="ltr" lang="EN-US" style="font-size:12.0pt">Borsan</span> <span dir="ltr" lang="EN-US" style="font-size:12.0pt">Construction</span><span style="font-size:12.0pt">, застройщики проекта</span></span></span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>\r\n\r\n<p style="text-align:justify">&nbsp;</p>	121
